        title: 'Python machine learning',
        page: '/python-machine-learning'
    },
    {
        image: 'java',
        category: 'Java',
        title: 'Java Spring Rest Crud Database',
        page: '/java-spring'
    },
    {
        image: 'webdev',
        category: 'Web Development',
        title: 'React Personal Website',
        page: '/react-website'
    },
    {
        image: 'java',
        category: 'Java',
        title: 'Java Finance & Web Scrape',
        page: '/java-finance-scrape'
    },
    {
        image: 'webdev',
        category: 'Web Development',
        title: 'Angular Full Commerce Website',
        page: '/angular-full-commerce'
    }
]

*/
//export default {ElsowinyPortfolioListContent}

export default {ElsowinyServiceList}
